(function(){
    var browser = {
        versions: function () {
            var u = navigator.userAgent
            return {
                //是否微信
                wx: u.toLowerCase().match(/MicroMessenger/i) == "micromessenger",
                //是否QQ
                qq: u.toLowerCase().indexOf(' qq') > -1,
                //是否百度
                baidu: u.indexOf('baidu') > -1,
                // uc浏览器
                uc:u.toLocaleLowerCase().indexOf('ucbrowser') > -1 || u.toLocaleLowerCase().indexOf('UCBrowser') > -1 || u.toLocaleLowerCase().match(/ucbrowser/) != null || u.toLocaleLowerCase().indexOf("uc") > -1
            };
        }(),
        language: (navigator.browserLanguage || navigator.language).toLowerCase()
    };
    if(browser.versions.wx || browser.versions.qq){
        var html = '';
        //html += '<div class="wxOpen" style="background-color: rgb(245, 245, 245);text-align: center;position: absolute;  left:0;  top:0;  width: 100%;  height: 100%;  z-index: 999;">';
        html += '<img src="data:image/png;base64," alt="" style="width:90%;vertical-align:middle;">';
        //html += '</div>';
        var wxOpen = document.createElement("div");
        wxOpen.className="wxOpen";
        wxOpen.setAttribute("style","box-sizing:border-box;padding-top:10px;position:fixed;left:0;top:0;right:0;bottom:0;background:rgba(0,0,0,.2);text-align:center;z-index: 9999;");
        wxOpen.innerHTML = html;
        document.body.appendChild(wxOpen);
    }
})()
